class Solution {
public:
    int maxOperations(string s) {
        int sum=0;int count=0;
        for(int i=0;i<s.length();i++){
            if(s[i]=='1'){
                count++;
                cout<<count<<" it is count"<<endl;
            }else{
                sum+=count;cout<<"sum is"<<sum<<endl;
                while(i<s.length() && s[i]=='0'){
                    i++;
                }
                i--;
            }
        }
        return sum;
    }
};
